import { Component } from '@angular/core';
import { UrlService } from '../services/url.service';

@Component({
  selector: 'app-my-urls-page',
  templateUrl: './my-urls-page.component.html',
  styleUrls: ['./my-urls-page.component.css']
})
export class MyUrlsPageComponent{
  list: Url[] = [];

  constructor(private urlsService: UrlService,
              private localStorage: M) {}

  retrieveUrls() {
    this.urlsService.getAll().subscribe((resp) => {
      this.list = resp;
    });
  }

}
